import React, { useEffect, useState } from "react";
import TextField from '@material-ui/core/TextField';
import { makeStyles, withStyles } from '@material-ui/core/styles';
import DarkTextField from './GlobalComponents';

const useStyles = makeStyles((theme) => ({
    mainConteiner: {
        marginTop: "1.5rem",  
        background: theme.palette.grey[800], 
        padding:"1rem"
    },
    root: {
        '& .MuiTextField-root': {
            margin: theme.spacing(1),
            width: '25ch',
        },
    },
}));

const CreateEmploy = () => {
    const classes = useStyles();
    const [employee, setEmployee] = useState({});

    useEffect(() => {

    }, []);

    const PostEmployee = () => {
        const requestOptions = {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({
                "id": 0, "name": "Json", "surname": "j",
                "phoneNumber": 0, "email": "temp@mail.net",
                "EmployeeAddressId": 0,
                "employeeAddress":
                    { "id": 0, "city": "New York", "postCode": "11-111", "street": "str 11" }
            })
        };
        fetch('http://localhost:5000/employee/build?type=linux-admin', requestOptions)
            .then(response => response.json())
            .then(data => console.log(data));
    }

    return (
        <div className={classes.mainConteiner}>
            <DarkTextField label="omg"/>
            <form className={classes.root} noValidate autoComplete="off">
                <div>
                    <TextField required id="standard-required" label="Required" defaultValue="Hello World" />
                    <TextField disabled id="standard-disabled" label="Disabled" defaultValue="Hello World" />
                    <TextField
                        id="standard-password-input"
                        label="Password"
                        type="password"
                        autoComplete="current-password"
                    />
                    <TextField
                        id="standard-read-only-input"
                        label="Read Only"
                        defaultValue="Hello World"
                        InputProps={{
                            readOnly: true,
                        }}
                    />
                    <TextField
                        id="standard-number"
                        label="Number"
                        type="number"
                        InputLabelProps={{
                            shrink: true,
                        }}
                    />
                    <TextField id="standard-search" label="Search field" type="search" />
                    <TextField
                        id="standard-helperText"
                        label="Helper text"
                        defaultValue="Default Value"
                        helperText="Some important text"
                    />
                </div>
            </form>
        </div>
    );
}
export default CreateEmploy;
